import './Featured.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBuilding, faHouse, faWarehouse } from '@fortawesome/free-solid-svg-icons';

import { Button, Col, Container, Row } from "react-bootstrap";

function Featured(){
    return(
        <Container fluid>
            <Container>
                <Row class = "d-flex align-items-center">
                    <Col lg = "4" md = "6" sm = "12" class = "featured-header">
                        <h5 className = "featured-uptitle">Our Recommendation</h5>
                        <h1>Featured House</h1>
                    </Col>

                    <Col lg = "4" md = "6" sm = "12" className = "featured-buttons">
                        <Button variant='success' size = "lg"><FontAwesomeIcon icon={ faHouse }/> House</Button>
                        <Button variant='secondary' size = "lg"><FontAwesomeIcon icon={ faWarehouse }/> Villa</Button>
                        <Button variant='secondary' size = "lg"><FontAwesomeIcon icon={ faBuilding }/> Apartment</Button>
                    </Col>

                    <Col lg = "4" md = "6" sm = "12">

                    </Col>
                </Row>
            </Container>
        </Container>
    )
}

export default Featured;
